import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

function Header() {
    return (
        <div className="bt-header">
            <Container>
                <Row>
                    <Col>1 of 2</Col>
                    <Col>2 of 2</Col>
                </Row>
            </Container>
        </div>
    )
}

export default Header
